gIO(){return"Hello, I'm Bruno, a Flutter developer."},
gIP(){return"I'm a self-taught Flutter developer with 4 years of experience. Clean code, attention to details and good UI design are my strong points."},
gGs(){return"About me"},
gJC(){return"More about me"},
